var r *rand.Rand

func init() {
	r = rand.New(rand.NewSource(time.Now().UnixNano()))
}

func GenPhoneNumber() string {
	return fmt.Sprintf("%d%04d%04d", PHONE_PRE3[r.Intn(len(PHONE_PRE3))], r.Intn(1000), r.Intn(1000))
}

func GenName() string {
	return strings.Replace(fmt.Sprintf("%s%s", FIRST_NAME[r.Intn(len(FIRST_NAME))], LAST_NAME[r.Intn(len(LAST_NAME))]), " ", "", -1)
}

func GenIdNo() string {
	n := r.Intn(2)
	return GenIdNoWithAge(0, n == 1)
}

func ResolveBirthDayFromIdNo(idNo string) string {
	if len(idNo) != 18 {
		return ""
	}
	return fmt.Sprintf("%s-%s-%s", idNo[6:10], idNo[10:12], idNo[12:14])
}

func GenIdNoWithAge(age int, female bool) string {
	n := r.Int31n(4706)
	if age == 0 {
		age = r.Intn(45) + 20
	}
	year := time.Now().AddDate(-1*age, 0, 0).Year()
	month := r.Intn(12) + 1
	day := r.Intn(30) + 1
	if month == 2 {
		day = r.Intn(28) + 1
	}
	index := r.Intn(1000)
	if female { //性别位:偶数为女,奇数为男
		index = index & 1022 //1111111110
	}
	idNo := fmt.Sprintf("%s%d%02d%02d%03d", ID_NO_PRE6[n], year, month, day, index)
	v := validateUtils.CalcValidateValue(idNo)
	return idNo + v
}

func genPassengerInfo() (idNo, name, phone string) {
	return GenIdNo(), GenName(), GenPhoneNumber()
}
